import { BrowserRouter } from "react-router-dom";
import Routes from "./Routes";
import TopBar from "./components/TopBar";
import Content from "./components/Content";

function App() {
  return (
    <div>
    <TopBar />
    <Content />
    <BrowserRouter>
      <div className="h-screen overflow-y-scroll font-sans">
        <Content />
        <Routes />
      </div>
    </BrowserRouter>
    </div>
  );
}

export default App;
